import {createActions} from 'redux-actions';
import {getAxios} from '../../api/index';
export const getPost = createActions({
    getPostRequest: undefined,
    getPostSuccess: ()=> {
        
        const getPost = getAxios();
        const data = getPost.then(e=>{
            return e.data;
        });
        const r = data().then(e=>e);
        console.log(data);
        const payload = [{
            title:'hhaaah'
        }]
        return payload;
    },
    getPostFalse: (err)=> err,
})
